import styled from "styled-components";

//styled-components
const TilesContainer = styled.div`
    display: flex;
    justify-content: center;
    flex-wrap: wrap;
`;

const SingleTile = styled.div`
    width: 300px;
    height: 240px;
    margin: 8px;
    border-radius: 10px;
    border: 1px solid #dce0f5;
    box-shadow: 0px 2px 10px #cfd0d6;
`;

//Components
const Tiles = ({ data }: any) => {
    return (
        <TilesContainer>
            {data.map((e: any, index: any) => {
                return (
                    <SingleTile key={index}>
                        <img
                            width="32px"
                            height="32px"
                            src={`https://www.kayak.com${data.logoURL}`}
                            alt={`${e.name} Logo`}
                        />
                        <p>{e.name}</p>
                    </SingleTile>
                );
            })}
        </TilesContainer>
    );
};

export default Tiles;
